properties.property:
local MessageBox = require "actions/MessageBox"
local BlockPlayer = require "actions/BlockPlayer"
local Do = require "actions/Do"

return function(self)
    return BlockPlayer {
        MessageBox {message="Locked."},
        Do(function() self:refreshKeyHint() end)
    }
end

local MessageBox = require "actions/MessageBox"
local Do = require "actions/Do"
local BlockPlayer = require "actions/BlockPlayer"

return function(self)
    local leaderMem = GameState.party[GameState.leader]
    if GameState.leader == "sally" then
        return BlockPlayer {
            MessageBox {
                message=leaderMem.name..": Nicole should be able to interface with this terminal.",
                blocking=true
            },
            Do(function()
                self:refreshKeyHint()
            end)
        }
    elseif GameState.leader == "bunny" then
        return BlockPlayer {
            MessageBox {
                message=leaderMem.name..": Oh my stars{p50}, this stuff looks complicated!",
                blocking=true
            },
            Do(function()
                self:refreshKeyHint()
            end)
        }
    elseif GameState.leader == "sonic" then
        return BlockPlayer {
            MessageBox {
                message=leaderMem.name..": This is really more of Sal's domain...",
                blocking=true
            },
            Do(function()
                self:refreshKeyHint()
            end)
        }
    elseif GameState.leader == "antoine" then
        return BlockPlayer {
            MessageBox {
                message=leaderMem.name..": This is not for me, I am thinking...",
                blocking=true
            },
            Do(function()
                self:refreshKeyHint()
            end)
        }
    end
end
